	function getphi (ph )
	{
		thisform = document.getElementById("search");

		thisform.detail.value='yes';
		thisform.phi_acc.value=ph;//  
		thisform.hchem.value='';
		thisform.name="sent_"+ph;
		thisform.submit() ;
